@frappe.whitelist()
def patch_attendance():
	# ratt = request_attendance

	get_att = frappe.db.sql("""

		SELECT ratt.`name`, ratt.`owner`, ratt.`from_date`, ratt.`to_date`, ratt.`docstatus`, ratt.`explanation` FROM `tabRequest Attendance` ratt
		WHERE ratt.`from_date` > "2021-03-31"
		AND ratt.`docstatus` = 1
		AND ratt.`owner` != "patch"

	""")
	if get_att :
		for att in get_att :

			doc = frappe.get_doc("Request Attendance", att[0])
			get_setting = frappe.get_single("HR Configuration")
			employee_exclude = []
			# if get_setting.exclude_employee_attendance :
			# 	for ex in get_setting.exclude_employee_attendance :
			# 		employee_exclude.append(ex.employee)

			request_days = date_diff(doc.to_date, doc.from_date) + 1
			for number in range(request_days):

				for i in doc.employee_list :

					if i.employee not in employee_exclude :

						attendance_date = add_days(doc.from_date, number)
						skip_attendance = doc.validate_if_attendance_not_applicable(attendance_date, i)
						if not skip_attendance:

							# edited rico
							get_employee = frappe.get_doc("Employee", i.employee)
							att_id = str(get_employee.biometric_id)+"#"+str(attendance_date)
							cek_att = frappe.get_value("Attendance", {"employee" : i.employee, "attendance_date" : attendance_date}, "name")
							if cek_att :

								print(str(att[0])+" = exist = "+str(i.employee)+" = exist = "+str(cek_att))

							else :

								attendance = frappe.new_doc("Attendance")
								attendance.employee = i.employee
								attendance.employee_name = i.employee_name
								if doc.half_day and date_diff(getdate(doc.half_day_date), getdate(attendance_date)) == 0:
									attendance.status = "Half Day"
								else:
									attendance.status = "Present"
								attendance.attendance_date = attendance_date
								attendance.company = doc.company
								attendance.request_attendance = doc.name


								# edited rico
								
								attendance.biometric_id = get_employee.biometric_id

								get_shift = frappe.get_doc("Employee", i.employee).default_shift

								if get_shift :
									get_work_time = frappe.get_doc("Shift Type", get_shift).work_time
									if get_work_time :
										for j in get_work_time :
											if j.days == str(getdate(str(attendance_date)).strftime("%A")) :
												attendance.start_time = j.start_time
												attendance.exit_time = j.exit_time


								attendance.save(ignore_permissions=True)
								attendance.submit()

								print(str(att[0])+" = new = "+str(i.employee)+" = new = "+str(attendance.name))

			frappe.db.sql(""" UPDATE `tabRequest Attendance` ra SET ra.`owner` = "patch" WHERE ra.`name` = "{}" """.format(str(att[0])))
			frappe.db.commit()



@frappe.whitelist()
def patch_ste_bp():
	get_ste = frappe.db.sql("""
		SELECT ste.`name`, ste.`set_posting_time`, ste.`posting_date`, ste.`posting_time` FROM `tabStock Entry` ste
		WHERE ste.`docstatus` = 1
		AND ste.`block_production` != ""
		AND ste.`block_production` IS NOT NULL
		AND ste.`owner` != "fixing"
		ORDER by ste.`posting_date` ASC
		LIMIT 100

	""")

	if get_ste :
		counter = 0
		for i in get_ste :
			try :
				ste = frappe.get_doc("Stock Entry", i[0])
				ste.flags.ignore_permissions = True
				ste.cancel()
				frappe.db.commit()

				frappe.db.sql(""" UPDATE `tabStock Entry` ste SET ste.`docstatus` = 0, ste.`owner` = "fixing" WHERE ste.`name` = "{}" """.format(i[0]))
				frappe.db.commit()

				ste = frappe.get_doc("Stock Entry", i[0])
				ste.flags.ignore_permissions = True
				ste.submit()
				frappe.db.commit()

				counter += 1

				print(str(counter) +" = "+ str(i[0]))

			except :
				counter += 1

				print(str(counter) +" = ERROR = "+ str(i[0]))




