@frappe.whitelist()
def update_nomor_awalan_pajak():

	# nomor revisi awalan sinv
    frappe.db.sql("""
        UPDATE `tabSales Invoice` sinv
		SET sinv.`nomor_revisi_pajak` = "0"
    """)
    frappe.db.commit()

    # nomor revisi awalan kinv
    frappe.db.sql("""
        UPDATE `tabKolektif Invoice` sinv
		SET sinv.`nomor_revisi_pajak` = "0"
    """)
    frappe.db.commit()

    # nomor awalan non wapu sinv
    frappe.db.sql("""
        UPDATE `tabSales Invoice` sinv
		LEFT JOIN `tabCustomer` c ON sinv.`customer` = c.`name`

		SET sinv.`nomor_awalan_pajak` = "01"

		WHERE c.`tipe_wapu` = "NON WAPU"
    """)
    frappe.db.commit()

    # nomor awalan non wapu kinv
    frappe.db.sql("""
        UPDATE `tabKolektif Invoice` sinv
		LEFT JOIN `tabCustomer` c ON sinv.`customer` = c.`name`

		SET sinv.`nomor_awalan_pajak` = "01"

		WHERE c.`tipe_wapu` = "NON WAPU"
    """)
    frappe.db.commit()

    # nomor awalan wapu sinv
    frappe.db.sql("""
        UPDATE `tabSales Invoice` kinv 
		LEFT JOIN `tabCustomer` c ON kinv.`customer` = c.`name`

		SET kinv.`nomor_awalan_pajak` = CASE
		    WHEN kinv.`grand_total` >= 10000000 THEN "03"
		    WHEN kinv.`grand_total` < 10000000 THEN "01"
		    ELSE kinv.`nomor_awalan_pajak`
		    END

		WHERE c.`tipe_wapu` = "WAPU"
    """)
    frappe.db.commit()

    # nomor awalan wapu kinv
    frappe.db.sql("""
        UPDATE `tabKolektif Invoice` kinv 
		LEFT JOIN `tabCustomer` c ON kinv.`customer` = c.`name`

		SET kinv.`nomor_awalan_pajak` = CASE
		    WHEN kinv.`grand_total` >= 10000000 THEN "03"
		    WHEN kinv.`grand_total` < 10000000 THEN "01"
		    ELSE kinv.`nomor_awalan_pajak`
		    END

		WHERE c.`tipe_wapu` = "WAPU"
    """)
    frappe.db.commit()



@frappe.whitelist()
def auto_make_payment_entry():

    data_invoice = frappe.db.sql("""
        SELECT sinv.`name`, sinv.`customer`, sinv.`posting_date`, sinv.`docstatus`
        FROM `tabSales Invoice` sinv
        WHERE sinv.`posting_date` BETWEEN "2020-01-01" AND "2020-08-31"
        AND sinv.`docstatus` = 1
        ORDER BY sinv.`posting_date`
    """)

    count = 0
    if data_invoice :
        for i in data_invoice :

            
            dt = "Sales Invoice"
            dn = i[0]
            doc = frappe.get_doc(dt, dn)
           
            party_type = "Customer"
            party_account = doc.debit_to
            party_account_currency = doc.get("party_account_currency") or get_account_currency(party_account)
            payment_type = "Receive"

            # amounts
            grand_total = outstanding_amount = 0

            if dt in ("Sales Invoice", "Purchase Invoice"):
                if party_account_currency == doc.company_currency:
                    grand_total = doc.base_rounded_total or doc.base_grand_total
                else:
                    grand_total = doc.rounded_total or doc.grand_total
                outstanding_amount = doc.outstanding_amount
           

            # bank or cash
            bank_account = ""
            bank = get_default_bank_cash_account(doc.company, "Bank", mode_of_payment=doc.get("mode_of_payment"), account=bank_account)

            paid_amount = received_amount = 0
            if party_account_currency == bank.account_currency:
                paid_amount = received_amount = abs(outstanding_amount)
            elif payment_type == "Receive":
                paid_amount = abs(outstanding_amount)
                if bank_amount:
                    received_amount = bank_amount

            pe = frappe.new_doc("Payment Entry")
            pe.payment_type = payment_type
            pe.company = doc.company
            pe.cost_center = doc.get("cost_center")
            pe.posting_date = doc.due_date
            pe.mode_of_payment = doc.get("mode_of_payment")
            pe.party_type = party_type
            pe.party = doc.get(scrub(party_type))
            pe.contact_person = doc.get("contact_person")
            pe.contact_email = doc.get("contact_email")
            

            pe.paid_from = party_account if payment_type=="Receive" else bank.account
            pe.paid_to = party_account if payment_type=="Pay" else bank.account
            pe.paid_from_account_currency = party_account_currency \
                if payment_type=="Receive" else bank.account_currency
            pe.paid_to_account_currency = party_account_currency if payment_type=="Pay" else bank.account_currency
            pe.paid_amount = paid_amount
            pe.received_amount = received_amount
            pe.allocate_payment_amount = 1
            pe.letter_head = doc.get("letter_head")

            if pe.party_type in ["Customer", "Supplier"]:
                bank_account = get_party_bank_account(pe.party_type, pe.party)
                pe.set("bank_account", bank_account)
                pe.set_bank_account_data()

            # only Purchase Invoice can be blocked individually
            
            pe.append("references", {
                'reference_doctype': dt,
                'reference_name': dn,
                "bill_no": doc.get("bill_no"),
                "due_date": doc.get("due_date"),
                'total_amount': grand_total,
                'outstanding_amount': outstanding_amount,
                'allocated_amount': outstanding_amount
            })

            pe.setup_party_account_field()
            pe.set_missing_values()
            if party_account and bank:
                pe.set_exchange_rate()
                pe.set_amounts()

            pe.reference_no = "-"
            pe.reference_date = doc.due_date
            
            pe.flags.ignore_permissions = True
            pe.save()

            count +=1

            print(str(count) + " = " + str(doc.name) + " = " + str(pe.name))






